    essay:
      '<p>Becoming a speech language pathologist, will greatly impact the lives of my future students. Teaching someone how to communicate is one of the most valuable skills one can learn, affecting every aspect of a person\'s life. I have had the privilege of working as a speech language technician for the last few years. The experiences that I have had, solidified my desire to gain a higher education and become a speech language pathologist. One experience, in particular, sticks out to me where I feel like I really made an impact on a student\'s life. I had been working with a boy, who was nonverbal, for a few months. I was tring to get him to communicate his wants and needs by simply signing "want" or "please. I was getting discouraged, thinking I was never going to get through to him. Finally, one day, it clicked! After that day, his one-word utterance of "more" expanded to "want more" or "more please". All of my patience and determination had paid off and I knew then that I had made a difference in his life.&nbsp; And although that is only one example of many that I have seen, I am excited to continue impacting future students lives by helping my future students gain confidence when speaking, producing their /r/ and /s/ sounds correctly, by helping them fix their ungrammatical sentences, by showing them the appropriate way to interact with their peers, etc. Communication has many facets, and I know I can help in some way.&nbsp;There is no better feeling than seeing the students you work with reach their goals, knowing that you had a hand in their success.</p>\n<div class="page" title="Page 1">\n<div class="section" style="background-color: rgb(100.000000%, 100.000000%, 100.000000%);">\n<div class="layoutArea">\n<div class="column">\n<p>&nbsp;</p>\n</div>\n</div>\n</div>\n</div>',
