      "<p>One of my passions in life is to make a difference in other's lives, which is one reason why I decided to become a speech-langugage pathologist (SLP). Once I started my SLP schooling, I knew I wanted to work with children in the educational setting. Helping children identify their speech problems and overcome them is personally rewarding to me. A child could have debilitating communication deficites, but I, as an SLP, would be able to assist them through their problems and become better speakers. If I am able to help a child get their voice, it could change their life for the better. By helping a student become a more fluent and audible speaker, we are giving them a future that they may not have had before. A student who stutters may not consider a public speaking career because of his or her speech, but if he or she&nbsp; visits the school's SLP who helps him become a more fluent speaker, then he or she's career posibilites open wide. That is how I want to impact my student's lives, by allowing them to reach their full potential and to help them attain their goals and dreams.&nbsp;</p>",
