      '<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif;">I have always wanted a career that would allow me to have a significant impact on the lives of others, which is why I chose the fields of speech-language pathology. Over the past two years, I have had the privilege of working with students with communication needs in a school setting. I believe speech and language skills are an important component to academic and social success. When working with my students, I felt like I was making a difference by helping them overcome their challenges and reach their fullest potential. During my time in the school setting, I was a member of the Emerging Leaders Project, a task force composed of related service providers, designed to develop ways to better serve our students in the school setting. I loved going to the meetings and returning to my district with ideas and programs we could consider to better serve our students. My goal upon completing my degree is to return to the school setting and be an advocate not only for students receiving speech therapy services, but for all students. In addition to communication and language skills, mental health is important part of academic success, and I am an avid proponent of incorporating things to promote positive mental health while at school. As a speech pathologist, I can play a part in promoting positive mental health by implementing schoolwide social skill programs and developing inclusion activities for students that may not otherwise get to participate in such things with their peers. </span></p>',
