    graduationDate: '05/2020',
    essay:
      "<p>&nbsp;</p>\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: 'Times New Roman'; mso-bidi-font-family: 'Times New Roman';\">I plan to be a light in the lives of my future students. As a future Speech-Language Pathologist (SLP), I will work with students who have communication disorders. Lacking basic communication skills, struggling to produce speech sounds, or having difficulty understanding language can darken the life of a child and his/her family members if left untreated. I want to enhance these students' communication to enable them to live full and social lives both inside and outside of the classroom.</span></p>\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: 'Times New Roman'; mso-bidi-font-family: 'Times New Roman';\">&nbsp;</span></p>\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: 'Times New Roman'; mso-bidi-font-family: 'Times New Roman';\">I used to babysit a little boy named Jace who has Autism. Jace was thought to be &ldquo;nonverbal&rdquo; before his school-based SLP introduced him to a communication device that allowed him to have a &ldquo;voice&rdquo;. I watched a little boy who grunted to communicate and wouldn&rsquo;t leave his mom&rsquo;s leg at daycare transform into an independent boy who communicates purposefully with his friends and family. Thanks to his SLP, Jace&rsquo;s whole demeanor changed after he found his &ldquo;voice&rdquo;. I want to enable children like Jace to live up to their potential just like this SLP did.</span></p>\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: 'Times New Roman'; mso-bidi-font-family: 'Times New Roman';\">&nbsp;</span></p>\n<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: 'Times New Roman'; mso-bidi-font-family: 'Times New Roman';\">Imagine life without communication. No child deserves to live in the dark. This is why I desire to be a light. </span></p>\n<p></p>",
