    essay:
      '<p><span style="font-size: 12pt; line-height: 107%; font-family: \'Times New Roman\', serif; letter-spacing: 0.15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Slow. Stupid. Retarded. These are just some of the verbal abuses children with special needs are forced to hear and endure every day at school. Whether it is the way they look, the way they move, or the way they talk, it does not matter. Watching these happy special needs kids who have no idea why they are different or even disliked, be spoken down to and purposely avoided has really opened my eyes as to how people treat others. As I continue to watch these students receive the brunt of many jokes, I am filled with compassion for them since the cruelty is completely undeserved. These observations have strengthened my dream of majoring in Speech Pathology and Audiology and eventually becoming a speech therapist. With this degree I want to help students to feel more comfortable and confident with at least one aspect of their lives, their speech.&nbsp;</span></p>',
