      '<p>Rachel Johnson</p><p>How I Plan on Impacting the Lives of My Future Students</p><p>Growing up, the world of education was always a focal point in my life. My mother was the principal of my elementary and middle school, so I practically lived there. She instilled in me the great value of education. Education can be a field of major sacrifice. Teachers, administrators, therapists, and other professionals in the education system give up time, money, and energy for the sake of their students. This is why I want to work in education as a Speech-Language Pathologist. It isn’t about the money, and it isn’t glamorous. However, it provides me the opportunity to reach a lot of children that have a variety of disorders, cultures, and socioeconomic statuses. I am particularly interested in language, literate language, and autism spectrum disorders. Because of this, I am currently completing a certificate from Eastern Kentucky University for working with individuals with autism spectrum disorders. I feel this certification will equip me with more tools to work in the school system and will help me provide better services to my future students. In the present state of our country, it is important that we prioritize the education system. Without quality educators, the future for our students looks rather dim. It is my goal to do my part in providing all students with the education and services they need to succeed.</p>',
