    refId: 'srXwFh227oNxFKEQbrTz',
    scholarshipId: 'clinical',
    graduationDate: '05/2020',
    essay:
      '<p>&nbsp;</p>\n<p><span style="font-family: Arial;"><span style="font-size: 14.6667px; white-space: pre-wrap;">Upon graduation from my Master of Science Program in Speech-Language Pathology in May 2020, I envision myself working as an SLP in a high-need, low income public school district. I believe working in a high need school district requires passion, dedication and perseverance, and I plan to work hard and use these three innate qualities in me to give my students the best possible access to their speech and language. I have always felt most enthusiastic and connected to my work when working with lower socioeconomic and high need populations. When I discovered the specialized training program at CSUSM, with an emphasis on training graduate students for enhanced practice with children in high need districts who experience low-incidence communication disorders arising from craniofacial anomalies (CFA), it immediately became my top choice graduate program. The training program&rsquo;s innovative specialization and goals are to train new grad SLPs to provide quality service to culturally and linguistically diverse children in high need public school settings, effectively assess and treat communication disorders associated, and to make ethically and scientifically sound decisions using evidence-based practice. I feel prepared and more excited than ever </span></span><span style="font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;">contribute to the betterment of my community. I am focused on improving the lives and raising the voice of those impaired in their communication in the low SES public school setting.</span></p>',
