  cjxf6xzyb00003b9l8m4ewabz: {
    id: 'cjxf6xzyb00003b9l8m4ewabz',
    school: 'University of Wisconsin-Eau Claire ',
    referrer: 'uwec',
    refId: 'AMIqfjPaOOkJtWJupxyM',
    scholarshipId: 'clinical',
    graduationDate: '12/2020',
    essay:
      '<p class="MsoNormal">Speech is our main form of communication, and when one has difficulty speaking, it can hinder their ability to communicate. Many times when someone cannot understand what another is saying, they nod along instead of trying to understand their message and truly listen to them. One day I will be a Speech Pathologist. I hope to help students who have difficulties communicating fix those difficulties and gain access to the world around them. I want to make these students understood. I believe that speaking is our greatest tool when used right, but when someone cannot get their point across, it can make it difficult to find their place in our society. I hope to one day bridge the gap between those who cannot be understood into being able to be understood.</p>',
    userId: 'wieseraa9983@uwec.edu',
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)'
  },
