    essay:
      '<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">My hope and plan to impact my future students.</span></p>\n<p><strong id="docs-internal-guid-e0f8496e-7fff-feec-2928-7f1b1f1189df" style="caret-color: #000000; color: #000000; font-family: -webkit-standard; font-style: normal; font-variant-caps: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; font-weight: normal;">&nbsp;</strong></p>\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">I plan to see you as the individual you are. I hope that you can look back and know that you were seen, heard, encouraged, understood, cared about, advised, been given patience, and you were able to grow in more ways than one.&nbsp;</span></p>\n<p><strong style="caret-color: #000000; color: #000000; font-family: -webkit-standard; font-style: normal; font-variant-caps: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; font-weight: normal;">&nbsp;</strong></p>\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">In order to impact and educate the lives of the students of tomorrow, one must first be able to learn themselves. Myself as a hopeful future Speech-Language Pathologist in a public school setting with an interest in special education students, I must fully learn all material that allows for me to be fully accountable, professional, efficient, knowledgeable and understanding as an educator. Aside from the assigned material needed to be learned for the career ahead, material needed to be learned and practiced should also be the experience and motivation to continuously learn for the duration of my life post undergraduate and postgraduate.&nbsp;</span></p>\n<p><strong style="caret-color: #000000; color: #000000; font-family: -webkit-standard; font-style: normal; font-variant-caps: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; font-weight: normal;">&nbsp;</strong></p>\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">As a future educator in this specific field, I will impact the future students of tomorrow by educating myself on all areas available to me of them as children or adolescents and never cease to learn from a mistake, an individual, an experience or an encounter. I am honored to pursue a field that allows for such an enriching experience for me to educate and learn from all individuals and experiences and do so for years to come.</span></p>',
