      '<p>&nbsp; &nbsp; &nbsp;I believe that in order to be an effective speech-language pathologist I need to know more than just how to teach speech classes or therapy. I want to be able to reach my students on a deeper level and make them feel seen, and special. My future students will come from diverse backgrounds and I intend to immerse myself in as many of these as I can. I already speak some Spanish but am working on becoming fluent. Additionlly I am going to begin American Sign Language classes this fall at the California School for the Deaf in Riverside. I will also be applying for a part time position at the Center for Autism and Related Disorders. While my school is teaching me the fundamentals of speech-language pathology, I realize that it is up to me to learn about the chiildren I will be working with, many of whom will come from Spanish speaking families, be hard of hearing or deaf, or have autism. Each applicant is taking the classes neccessary to teach their individual field, but what I will bring to the table is compassion, empathy, and true desire to understand my students and to make them feel understood and accepted, and I will be doing everything I can to prepare myself to do just that.</p>',
