  cjxo61tll00003g8bj09zswup: {
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)',
    id: 'cjxo61tll00003g8bj09zswup',
    school: 'University of Alabama',
    referrer: 'ALABAMTUSCA',
    refId: '2lsyfampfotlXz3b8Blw',
    scholarshipId: 'clinical',
    graduationDate: '05/2020',
    essay:
      '<p>Olivia Ann Mossides</p><p>I was born 24 weeks premature and the youngest baby born in Ohio. I weighed 1lb 4oz, had 3 heart attacks, developed multiple disabilities and my parents were told that everyday of life was a gift. But the doctors had no idea who my parents were; for they fought, demanded and prayed life into me.</p><p>The doctors were right for I had multiple disabilities; I was delayed and needed occupation, physical and speech therapy. With a mother as a teacher, she was always researching new ideas, working with me several times a day and keeping up with my medical concerns. My biggest struggle was learning how to suck, swallow and breath; which took seven months. With hard work and daily practice, my delays started to decline at age seven except for my speech and language skills. I had therapy daily, privately and in-group sessions. I continued when I started school and maintained my private sessions all year around until high school.</p><p>Oral language was difficult for me. I had a lateral lisp and lazy tongue that would not let me articulate clearly. I can remember talking and then becoming frustrated because no one understood. Hours of practice and exercises helped me communicate. I was teased by some of my peers but learned how to handle it. My therapist taught me how to articulate but my mom taught me how to handle people. I graduated from speech in 8<sup>th</sup> grade. In high school, I was selected to become a peer partner for disabled peers. Many of my peers had multiple disabilities but I found myself always intrigued with peers who had a speech impartment. I found myself truly enjoying class and at the end of my junior year, I knew that I wanted to be a speech pathologist.</p><p>As I take my classes in communication disorder, I am able to understand how the pieces fit together. I feel that I will have an insight; as being a student and someday a therapist. Incorporating skills on how to overcome frustration while learning how to communicate will help the students and our community.</p>',
    userId: 'oamossides@crimson.ua.edu'
  },
