  cjxqkswuw00003b9e86pxytk8: {
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)',
    id: 'cjxqkswuw00003b9e86pxytk8',
    school: 'Idaho State University',
    referrer: 'ISU',
    refId: 'Lcj7NecxTpyhLmx4bjLn',
    scholarshipId: 'clinical',
    graduationDate: '05/2020',
    essay:
      '<p class="MsoNormal" style="text-indent: .5in;"><span style="font-size: 10.5pt; line-height: 107%; font-family: \'Verdana\',sans-serif; color: black; background: white;">In speech-language pathology, there are so many ages and populations of people that can benefit from the services we provide. Children, and particularly children with special needs, are at the forefront of my mind. Working with children on their communication is a rewarding and necessary piece of their life, it increases their ability to fulfill their basic and social needs. I intend on impacting the lives of my future students by not only meeting these needs, but also increasing their confidence and self-worth by showing them that they can accomplish anything they put their mind to. Encouraging them that practice makes perfect and showing them that I am at least one person they can trust and really want them to succeed.&nbsp;</span></p>\n<p class="MsoNormal" style="text-indent: .5in;"><span style="font-size: 10.5pt; line-height: 107%; font-family: \'Verdana\',sans-serif; color: black; background: white;">There are so many kids in one school that certain children can feel lost in the crowd; I know I did at times. These kids might feel forgotten, especially if they&rsquo;re struggling academically or socially. To give these kids support; to foster personal and academic growth allowing them to shine in front of their peers and teachers is important. I am a proponent of making sure that any time spent receiving special services makes a tangible difference. There are kids getting pulled out of class once every two weeks; to be honest it makes no tangible difference. For the kids who need speech or language services, my contribution is giving my time and energy to giving them and their families the expertise and time they need to noticeably improve and grow. </span></p>',
    userId: 'trimaman@isu.edu'
  },
  cjxqzkp8u00003e88qnf2ujbi: {
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)',
    id: 'cjxqzkp8u00003e88qnf2ujbi',
    school: 'Florida International University ',
    referrer: 'FIU',
    refId: '1GkgtPng5q3CeymTVPUY',
    scholarshipId: 'clinical',
    graduationDate: '07/2021',
    essay:
      '<p class="MsoNormal" style="margin: 0in 0in 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; text-indent: 0.5in; line-height: 32px;"><span style="font-family: \'Times New Roman\', serif;">Communication is the cornerstone of human connection. I learned that lesson at the age of 9 when I moved to the United States with my mother and I began school in this country. As a native Spanish speaker, I tried to acclimate to the American culture and the language. However, my peers often ridiculed me for my broken English.&nbsp;&nbsp;I was so distraught by the experience that I was afraid to speak in class and I avoided conversations by all means. My teacher, Mrs. Leal, noticed my withdrawal in class and spoke with me privately. After many years, her words still carry much weight. She told me that everyone has a story to tell and I should never be ashamed to speak up, nor be different. Although I did not have speech impairment, through that experience, I deeply empathize with children who have communication disorders and/or other disabilities who face many challenges because they are different.&nbsp;</span></p>\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; text-indent: 0.5in; line-height: 32px;"><span style="font-size: 12pt; text-indent: 0px; font-family: \'Times New Roman\', serif;">As a Speech-Language Pathologist I aspire to work in schools where I can provide students with the tools not only to communicate, but to do so with confidence. It is a profession where I aim to devote my skills to offer a better quality of life to others.&nbsp;</span><span style="font-size: 12pt; text-indent: 0px; font-family: \'Times New Roman\', serif;">A teacher who believed in me impacted my life at a young age. I hope one day I can also empower individuals to break down any barriers that keep them from communicating with the world.&nbsp;</span><span style="font-size: 12pt; text-indent: 0px; font-family: \'Times New Roman\', serif;">I appreciate your consideration.&nbsp;</span></p>\n<p>&nbsp;</p>',
    userId: 'gpere045@fiu.edu'
  },
