    essay:
      '<p>To whom it may concern,</p>\n<p>I intend on impacting the lives of my future students by creating a safe and fun environment for certain individuals under my wing. Growing up, I had many role models and speciailsts that had helped me whether it be a broken bone, schooling, life obstacles, or just simple things such as household tasks. Through my personal experiences I have been a classroom aide in my sophomore high school term, by following up I was later a full time subsituute teacher after graduating Idaho Falls High School (academic grades K-12). Previously upon experience there would be that one invidiviudal(s) that you came across in a profession that would just be there for a paycheck, and not to better their personal obligations, let alone the children in need(s). Once I obtain my degree, I will strive to be the best that I can be for my future students. Helping children and ICU patients has always been a broad goal of mine, and to manage that I need to be comfortable with myself and my learned information. I have always grown up around special needs, speech impetiments, dissabilites, etc. From my understanding it always takes that one person along with that one breakthrough to help the indiviual feel like they matter, because they do. I intend on impacting the lives of my future students to make them feel comfortable and needed. No matter how quiet or loud someone may be, they could hold a very important part of information verbally or thoughtfully. It is up to me in my positon to bring them out of their shells and create a safe environment for themselves and those around. If I had recieved this scholarship it would mean alot to me due to me being a first time college attendee in my family. I would put it to use by purchasing what is needed to set myself up for success in the short and long term attributes. &nbsp;</p>\n<p>Best regards, Brandon Hurst&nbsp;</p>',
