    graduationDate: '05/2021',
    essay:
      '<div class="OutlineElement Ltr  BCX1 SCXW248305241" style="clear: both; color: #000000; cursor: text; direction: ltr; font-family: &amp;quot; segoe ui&amp;quot;,&amp;quot;segoe ui web&amp;quot;,arial,verdana,sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; -ms-touch-select: none; -ms-user-select: text; orphans: 2; overflow: visible; position: relative; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-tap-highlight-color: transparent; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; padding: 0px; margin: 0px;">\n<p class="Paragraph SCXW248305241 BCX1" style="background-color: transparent; color: windowtext; font-style: normal; font-weight: normal; -ms-touch-select: none; -ms-user-select: text; overflow-wrap: break-word; text-align: left; text-indent: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;"><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">My name is Anita Bravo Cobian, and I am studying to become a Speech Language Pathologist. I am currently a ju</span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">nior at Eastern New Mexico University. The </span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">further I get into t</span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">his </span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">program, the bigger my passion grows to help young children who have speech impediments. I am also interested in working with bilingual students. When I graduate with my Bachelor\'s degree, I would like to obtain my Master\'s degree. After this, I would like to gain experience as a licensed Speech Language Pathologist. </span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">My dream is to work with elementary students in public schools. </span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">Once I gain some experience, I would like to open my own clinic with a variety of therapists joining me, including but not limited to: a physical therapist, an occupational therapist, a speech language therapist, etc. I want to make it easy for communities of families and children to access each of these forms of therapy to help improve their lives. I am passionate </span></span><span class="TextRun SCXW248305241 BCX1" lang="EN-US" style="color: #000000; font-family: Times New Roman,Times New Roman_MSFontService,Serif; font-size: 12pt; line-height: 20.34px; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;" xml:lang="EN-US" data-contrast="none"><span class="NormalTextRun SCXW248305241 BCX1" style="background-color: inherit; -ms-touch-select: none; -ms-user-select: text; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px;">to use my education to help students achieve their dreams.</span></span></p>\n</div>\n<p>&nbsp;</p>',
