  cjy7a2ez700003m90um9ki2fq: {
    referrer: 'LAMAR',
    refId: 'hWzBGWfb1FXsE42PBPsB',
    scholarshipId: 'clinical',
    graduationDate: '05/2020',
    essay:
      '<p>&nbsp;</p>\n<p style="margin: 0px 0px 10.66px;"><span style="font-family: Calibri;">This summer I was involved as part of my clinic experience to work with children ages 8-18 in producing a play at the local theatre. Some of these children had ASD and other developmental disorders. It was such an amazing experience and it made me realize that using the arts is such an amazing way to improve communication skills in school ages kids. </span></p>\n<p>&nbsp;</p>\n<p style="margin: 0px 0px 10.66px;"><span style="font-family: Calibri;">As a mother of a small child in elementary school, it has been my goal for some time to work in a school district despite lower pay and high number of caseloads. I know from personal experience that being happy in a career is even more important than making money. However, I wonder how can I take a large number of kids and put them together to learn these skills with their peers? I saw that work this past semester in my theatre program. <span style="margin: 0px;">&nbsp;</span></span></p>\n<p>&nbsp;</p>\n<p style="margin: 0px 0px 10.66px;"><span style="font-family: Calibri;">Being a long- time lover of the arts (arts, dance and music) my goal would be to work with art teachers and school staff to ensure that there will be opportunities for all to create these memorable and empowering experiences. After all, offering education in this context is meaningful and can be used in daily interactions. More importantly for older kids, it can be a guide as they enter the workplace. This also educates peers on how to communicate with a person with ASD. <span style="margin: 0px;">&nbsp;</span>I would advocate for these kids and explain that with proper education and techniques, anyone can be a part of a theatre program and really shine in the hopes that they could tackle anything they wanted to do in the future with some of the skills they learned. </span></p>\n<p>Alayna Magnuson</p>',
    userId: 'amagnuson@lamar.edu',
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)',
    id: 'cjy7a2ez700003m90um9ki2fq',
    school: 'Lamar University '
  },
  cjy91h2kx00003h9hz5cow5hi: {
    referrer: 'uwec',
    refId: 'zVNGUlbOvjy5ryZ5HEja',
    scholarshipId: 'clinical',
    graduationDate: '05/2020',
    essay:
      "<p>Already being able to work in the public school setting as an SLPA, I have had the opportunity to work a diverse range of student who's differences vary according to socio economic status, cognitive/physical ability, race/culture, etc. Serving populations from head start to high school, I enjoy getting to see how the student work to achieve their goals and progress on throughout grade levels. Knowing that what I do with these students will impact their transition from elementary to middle school, and middle school to high school motivates me to do my best every single day. I work, and plan to work as a full-time SLP once graduated, extra hours to find the best, EBP interventions for my students who's disabilities range from mild to very severe in order to ensure that needs are met. Not only do I want to serve these students in speech services, but I hope that every one of my students will know they are loved and cared for.&nbsp;</p>",
    userId: 'walterd6766@uwec.edu',
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)',
    id: 'cjy91h2kx00003h9hz5cow5hi',
    school: 'University of Wisconsin-Eau Claire'
  },
