    referrer: 'uwec',
    refId: '15Yip8bpgchtw61eO65I',
    scholarshipId: 'clinical',
    graduationDate: '05/2024',
    essay:
      '<p>As an individual striving to become a Speech and Language Pathologist in elementary schools, I will be working with many children throughout my career. I intend on not only impacting the way the are able to communicate, but their ability to become upstanding people as well. My goal is to not only graduate them from speech, but to graduate them into better characters. I will work on social and behavioral skills along with speech, training the children on how they will be able to act outside of school.</p>',
