  cjzrra0yt00003a9loldhqaow: {
    personalStatement: 'How do I intend on impacting the lives of my future students? (Maximum 250 Words)',
    id: 'cjzrra0yt00003a9loldhqaow',
    school: 'West Texas A&M University',
    referrer: 'wtamu',
    refId: 'EfUxobhBWqQRfZURqFDW',
    scholarshipId: 'clinical',
    graduationDate: '05/2021',
    essay:
      '<p>As a future Speech-Language Pathologist, my goal is to create a comfortable, fun, and easily learning environment for my students. I believe my students will achieve their goal within an environment that &ldquo;feels like home&rdquo;. Building activities and different ways for therapy will also help motivate my students into improvement. Further guidance and interacting with my students one on one will then create a relationship of trust, thus gaining room for improvement. Been given the opportunity to study within this profession and acquire the skills to help and create an impact on a child or adult, is a goal to look for in the future. It is not about being perfect, but only feeling like ones self again and knowing that todays speech and language is better than yesterdays.</p>',
    userId: 'blanca-urquidi@hotmail.com'
  },
