    essay:
      '<p>&nbsp;</p>\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span style="font-size: 12.0pt; font-family: \'Times New Roman\'; mso-fareast-font-family: \'Times New Roman\';">I hope to help them in a way that allows them to better communicate their thoughts and feelings to the people around them. Whether that be working on being better understood by their peers or organizing their thoughts so they can be understood. I have always had a heart for children and especially the child that doesn&rsquo;t seem to always fit in. I know that a lot of children struggle with some aspect of their speech and that can discourage them from engaging with their peers. My hope is to provide a safe environment where children feel comfortable enough to express themselves and build relationships with their classmates while also working on their communication skills. My mom works in a low income school district and the children in her class have tough home lives. But I have always admired how she continues to go to school every day and work with the children and let them know that somebody cares about them and wants them to succeed. I would like to be able to do a similar thing with my students. I want them to know that no matter what is happening in their lives they have someone in their corner who cares about them and is wanting them to succeed. Being able to be understood is such an important part of life and I would love to help future students be able to be understood.</span></p>\n<p></p>',
