      "<p>As a future speech pathologist, I plan on impacting my future students' lives by creating the best school environment for them individually. Everyone has their own strengths, and it is my goal to discover each of my students so that they are able to learn and grow in the best way for them individually. I want them to grow into individuals that have a positive mindset despite the challenges they face. I want them to believe in themselves and have goals for the future. Not only will I be a positive role model them, but I will also talk about well-known people who have been extremely successful despite having disabilities&nbsp;that way they'll be able to have a role model that resembles them as well.&nbsp;</p>",
