    essay:
      '<p>&nbsp;</p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-indent: .5in;"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">As a speech language pathologist working in the schools, it will be my goal to help students gain skills needed for success across various contexts and domains. Teaching skills that will assist them in their ability to communicate their wants and needs, initiate social interactions and improve academic performance are some of the elements I would want to ensure are included in intervention. It would also be important to improve skills in reading and writing as well as verbal speech production. Implementing functional skills and practices will allow for generalization and improved outcomes as students continue on in their academic career. </span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-indent: .5in;"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">When working with children in the school setting, creating an environment in which children are encouraged to participate despite their level of knowledge or ability will be essential for improving speech and language skills. For children with special needs, it will also be important to challenge them yet alter intervention to make it individualized to their needs. </span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-indent: .5in;"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">I believe that as a speech language pathologist, I can help children reach their full potential and be a resource to aid in their success as students and individuals. Working under experienced speech language pathologists in my previous experiences as well as in graduate school has shown me what qualities are necessary in a quality clinician. I want to continue helping children manifest the skills necessary to produce and improve their speech and language abilities as it will contribute to their success. </span></p>\n<p class="MsoNormal">&nbsp;</p>\n<p></p>',
